import React from 'react';

export default class NavBar extends React.Component{
    render(){
        const navbarContent = ['Desigenrs', 'Shoes', 'Bags', 'Belts', 'Sale']
    return(
        <ul style={decor.menu}>
            {
            navbarContent.map((ele)=>{
            return <li>{ele}</li>
            })
            }
        </ul>

    )
}
}

const decor = {
    menu:{
        display: 'grid',
        gridTemplateColumns: 'repeat(5, 1fr)',
        alignItems: 'center',
        backgroundColor: 'black',
        color: 'white'
    }
}
